const Navbar_Routes = [
    {
        label: "Home",
        path: "/"
    },
    {
        label: "Diary",
        path: "/diary"
    },
    {
        label: "Adoption",
        path: "/adoption"
    },
    {
        label: "Game",
        path: "/game"
    },
    {
        label: "My Kitten",
        submenu: [
            {
                label: "",
                path: ""
            },
            {
                label: "",
                path: ""
            },
            {
                label: "",
                path: ""
            }
        ]
    }
];

export default Navbar_Routes;
